I'm trying to create a rust app that can read the contents of the clipboard aloud using the elevenlabs.io api. I've been looking at the documentation for the elevenlabs.io api and the `clipboard` crate, but I'm not sure how to put it all together.

Here's what I have so far:

```
use clipboard::ClipboardProvider;
use reqwest::Client;
use serde::Deserialize;

#[derive(Deserialize)]
struct TextToSpeechResponse {
    audio: String,
}

async fn text_to_speech(client: &Client, text: &str) -> Result<TextToSpeechResponse, reqwest::Error> {
    let response = client
        .post("https://api.elevenlabs.io/v1/text-to-speech/21m00Tcm4TlvDq8ikWAM")
        .header("xi-api-key", "YOUR_API_KEY")
        .json(&json!({
            "text": text,
            "voice_settings": {
                "stability": 0.5,
                "similarity_boost": 0.75,
            }
        }))
        .send()
        .await?
        .json()
        .await?;

    Ok(response)
}

#[tokio::main]
async fn main() -> Result<(), Box<dyn std::error::Error>> {
    let client = Client::new();
    let text = ClipboardProvider::new().get_contents().unwrap();
    let response = text_to_speech(&client, &text).await?;
    println!("{:?}", response);

    Ok(())
}
```

I'm not sure how to play the audio from the response, or if I even need to do that since the API returns a base64 encoded audio file. I'm also not sure how to handle errors from the `ClipboardProvider`.

Any help would be appreciated!

## Answer (1)

You can use the `play-sound` crate to play the audio. You can use the `base64` crate to decode the base64 string. You can use the `thiserror` crate to define your own error type and use it in your `text_to_speech` function.

Here's an example of how you can modify your code to include these changes:

```
use clipboard::ClipboardProvider;
use reqwest::Client;
use serde::Deserialize;
use play_sound::play;
use base64::decode;
use thiserror::Error;

#[derive(Debug, Error)]
enum MyError {
    #[error("Failed to decode base64 string: {0}")]
    Base64DecodeError(#[from] base64::DecodeError),
    #[error("Failed to play sound: {0}")]
    PlaySoundError(#[from] play_sound::Error),
    #[error("Failed to get clipboard contents: {0}")]
    ClipboardError(#[from] clipboard::Error),
    #[error("Failed to make API request: {0}")]
    ApiError(#[from] reqwest::Error),
}

#[derive(Deserialize)]
struct TextToSpeechResponse {
    audio: String,
}

async fn text_to_speech(client: &Client, text: &str) -> Result<TextToSpeechResponse, MyError> {
    let response = client
        .post("https://api.elevenlabs.io/v1/text-to-speech/21m00Tcm4TlvDq8ikWAM")
        .header("xi-api-key", "YOUR_API_KEY")
        .json(&json!({
            "text": text,
            "voice_settings": {
                "stability": 0.5,
                "similarity_boost": 0.75,
            }
        }))
        .send()
        .await?
        .json()
        .await?;

    Ok(response)
}
